def _save_ships_to_file(ships):
    lines = []
    filename = "ships.txt"
    with open(filename, "w") as f:
        for j in range(9):
            line = ''
            for i in range(2, 16):
                line += str(ships[j][i]) + ' '
            line += '0\n'
            lines.append(line)
        for line in lines:
            f.write(line)
    f.close()
    text = "ships data saved to file:\n%s" % (ships)
    _log(text)
    print(text)

