    text = "to_check_ids_tab_1 list:\n%s" % (to_check_ids_tab_1)
    _log(text)
    print(text)
    text = "to_check_ids_tab_1_a list:\n%s\nand tab_1_b: %s\nand tab_1_c: %s" % (to_check_ids_tab_1_a, to_check_ids_tab_1_b, to_check_ids_tab_1_c)
